// database manager
CG_ERR_RESULT
dbman (int dbversion, AppSettings appsettings)
{
  CG_ERR_RESULT result = CG_ERR_DBACCESS;
  	
  switch (dbversion)
  {
	case 1:  
	  result = version1 (appsettings);
	  if (result != CG_ERR_OK)
	    return result;
	case 2: 
	  result = version2 (appsettings);
	  if (result != CG_ERR_OK)
	    return result;  
	case 3: 
	  result = version3 (appsettings);
	  if (result != CG_ERR_OK)
	    return result;  
	case 4: 
	  result = version4 (appsettings);
	  if (result != CG_ERR_OK)
	    return result;  
	case 5: 
	  result = version5 (appsettings);
	  if (result != CG_ERR_OK)
	    return result;   
	case 6: 
	  result = version6 (appsettings);
	  if (result != CG_ERR_OK)
	    return result;    
	case 7: 
	  result = version7 (appsettings);
	  if (result != CG_ERR_OK)
	    return result;                     
  }	
  
  return result;  
}
